In this example we cover: Implementing a recursive algorithm (graph reachability) via cyclic dataflow Operators to merge data from multiple inputs ( merge ), and send data to multiple outputs ( tee ) An example of how a cyclic dataflow in one stratum executes to completion before starting the next stratum. To expand from graph neighbors to graph reachability, we want to find vertices that are connected not just to origin, but also to vertices reachable transitively from origin. Said differently, a vertex is reachable from origin if it is one of two cases: a neighbor of origin or a neighbor of some other vertex that is itself reachable from origin. It turns out this is a very small change to our Hydroflow program! Essentially we want to take all the reached vertices we found in our graph neighbors program, and treat them recursively just as we treated origin. To do this in a language like Hydroflow, we introduce a cycle in the flow: we take the join output and have it flow back into the join input. The modified intuitive graph looks like this: graph TD subgraph sources 01[Stream of Edges] end subgraph reachable from origin 00[Origin Vertex] 10[Reached Vertices] 20("V ⨝ E") 40[Output] 00 --&gt; 10 10 --&gt; 20 20 --&gt; 10 01 --&gt; 20 20 --&gt; 40 end Note that we added a Reached Vertices box to the diagram to merge the two inbound edges corresponding to our two cases above. Similarly note that the join box V ⨝ E now has two outbound edges; the sketch omits the operator to copy ("tee") the output along two paths. Now lets look at a modified version of our graph neighbor code that implements this full program, including the loop as well as the Hydroflow merge and tee : # use hydroflow::hydroflow_syntax;
pub fn main() { // An edge in the input data = a pair of `usize` vertex IDs. let (pairs_send, pairs_recv) = hydroflow::util::unbounded_channel::<(usize, usize)>(); let mut flow = hydroflow_syntax! { // inputs: the origin vertex (vertex 0) and stream of input edges origin = source_iter(vec![0]); stream_of_edges = source_stream(pairs_recv); reached_vertices = merge(); origin -> [0]reached_vertices; // the join my_join_tee = join() -> flat_map(|(src, ((), dst))| [src, dst]) -> tee(); reached_vertices -> map(|v| (v, ())) -> [0]my_join_tee; stream_of_edges -> [1]my_join_tee; // the loop and the output my_join_tee[0] -> [1]reached_vertices; my_join_tee[1] -> unique() -> for_each(|x| println!("Reached: {}", x)); }; println!( "{}", flow.serde_graph() .expect("No graph found, maybe failed to parse.") .to_mermaid() ); pairs_send.send((0, 1)).unwrap(); pairs_send.send((2, 4)).unwrap(); pairs_send.send((3, 4)).unwrap(); pairs_send.send((1, 2)).unwrap(); pairs_send.send((0, 3)).unwrap(); pairs_send.send((0, 3)).unwrap(); flow.run_available();
} And now we get the full set of vertices reachable from 0: Reached: 3
Reached: 0
Reached: 2
Reached: 4
Reached: 1 Let's review the significant changes here. First, in setting up the inputs we have the addition of the reached_vertices variable, which uses the merge() op to merge the output of two operators into one. We route the origin vertex into it as one input right away: reached_vertices = merge(); origin -> [0]reached_vertices; Note the square-bracket syntax for differentiating the multiple inputs to merge() is the same as that of join() (except that merge can have an unbounded number of inputs, whereas join() is defined to only have two.) Now, join() is defined to only have one output. In our program, we want to copy the joined output output to two places: to the original for_each from above to print output, and also back to the merge operator we called reached_vertices. We feed the join() output through a flat_map() as before, and then we feed the result into a tee() operator, which is the mirror image of merge(): instead of merging many inputs to one output, it copies one input to many different outputs. Each input element is cloned , in Rust terms, and given to each of the outputs. The syntax for the outputs of tee() mirrors that of merge: we append an output index in square brackets to the tee or variable. In this example we have my_join_tee[0] -> and my_join_tee[1] ->. Finally, we process the output of the join as passed through the tee. One branch pushes reached vertices back up into the reached_vertices variable (which begins with a merge), while the other prints out all the reached vertices as in the simple program. my_join_tee[0] -> [1]reached_vertices; my_join_tee[1] -> for_each(|x| println!("Reached: {}", x)); Note the syntax for differentiating the outputs of a tee() is symmetric to that of merge(), showing up to the right of the variable rather than the left. Below is the diagram rendered by mermaid showing the structure of the full flow: flowchart TB subgraph "sg_1v1 stratum 0" 1v1["1v1 &lt;tt&gt;op_1v1: source_iter(vec! [0])&lt;/tt&gt;"] 2v1["2v1 &lt;tt&gt;op_2v1: source_stream(edges_recv)&lt;/tt&gt;"] 3v1["3v1 &lt;tt&gt;op_3v1: merge()&lt;/tt&gt;"] 7v1["7v1 &lt;tt&gt;op_7v1: map(| v | (v, ()))&lt;/tt&gt;"] 4v1["4v1 &lt;tt&gt;op_4v1: join()&lt;/tt&gt;"] 5v1["5v1 &lt;tt&gt;op_5v1: flat_map(| (src, ((), dst)) | [src, dst])&lt;/tt&gt;"] 6v1["6v1 &lt;tt&gt;op_6v1: tee()&lt;/tt&gt;"] end subgraph "sg_2v1 stratum 1" 8v1["8v1 &lt;tt&gt;op_8v1: unique()&lt;/tt&gt;"] 9v1["9v1 &lt;tt&gt;op_9v1: for_each(| x | println! (&amp;quot;Reached: {}&amp;quot;, x))&lt;/tt&gt;"] end 10v1{"handoff"} 11v1{"handoff"} 1v1--&gt;3v1 2v1--&gt;4v1 3v1--&gt;7v1 4v1--&gt;5v1 5v1--&gt;6v1 6v1--&gt;10v1 6v1--&gt;11v1 7v1--&gt;4v1 8v1--&gt;9v1 10v1--&gt;3v1 11v1--&gt;8v1 This is similar to the flow for graph neighbors, but has a few more operators that make it look more complex. In particular, it includes the merge and tee operators, and a cycle-forming back-edge that passes through an auto-generated handoff operator. This handoff is not a stratum boundary (after all, it connects stratum 0 to itself!) Rather, it represents a compilation boundary: the compiled code that Hydroflow generates is acyclic (as discussed in the Architecture Chapter ), so these handoffs tell the runtime to iterate on the acyclic code of a stratum until there is no new output from the stratum. Meanwhile, note in the mermaid diagram that there is once again a stratum boundary between the stratum 0 with its recursive loop, and stratum 1 that computes unique. This means that Hydroflow will first run the loop continuously until all the transitive reached vertices are found, before moving on to compute the unique reached vertices.

