Things get interesting when we look at the run_server function. This function is the main entry point for the server. It takes as arguments the outbound and inbound sockets from main, and the Opts (which are ignored). After printing a cheery message, we get into the Hydroflow code for the server, consisting of three short pipelines. use crate::protocol::EchoMsg;
use chrono::prelude::*;
use hydroflow::hydroflow_syntax;
use hydroflow::scheduled::graph::Hydroflow;
use hydroflow::util::{UdpSink, UdpStream};
use std::net::SocketAddr; pub(crate) async fn run_server(outbound: UdpSink, inbound: UdpStream, _opts: crate::Opts) { println!("Server live!"); let mut flow: Hydroflow = hydroflow_syntax! { // Define a shared inbound channel inbound_chan = source_stream_serde(inbound) -> tee(); // Print all messages for debugging purposes inbound_chan[0] -> for_each(|(msg, addr): (EchoMsg, SocketAddr)| println!("{}: Got {:?} from {:?}", Utc::now(), msg, addr)); // Echo back the Echo messages with updated timestamp inbound_chan[1] -> map(|(EchoMsg {payload, ..}, addr)| (EchoMsg { payload, ts: Utc::now() }, addr) ) -> dest_sink_serde(outbound); }; // run the server flow.run_async().await;
} Lets take these one at a time. The first pipeline, inbound_chan uses a source operator we have not seen before, source_stream_serde() . This is a streaming source like source_stream, but for network streams. It takes a UdpSource as an argument, and has a particular output type: a stream of (T, SocketAddr) pairs where T is some type that implements the Serialize and Deserialize traits (together known as "serde"), and SocketAddr is the network address of the sender of the item. In this case, T is EchoMsg, which we defined in protocol.rs, and the SocketAddr is the address of the client that sent the message. We pipe the result into a tee() for reuse. The second pipeline is a simple for_each to print the messages received at the server. The third and final pipeline constructs a response EchoMsg with the local timestamp copied in. It then pipes the result into a sink operator we have not seen before, dest_sink_serde() . This is a sink operator like dest_sink, but for network streams. It takes a UdpSink as an argument, and requires a particular input type: a stream of (T, SocketAddr) pairs where T is some type that implements the Serialize and Deserialize traits, and SocketAddr is the network address of the destination. In this case, T is once again EchoMsg, and the SocketAddr is the address of the client that sent the original message. The remaining line of code runs the server. The run_async() function is a method on the Hydroflow type. It is an async function, so we append .await to the call. The program will block on this call until the server is done.

