The chat server is nearly as simple as the echo server. The main differences are (a) we need to handle multiple message types, (b) we need to keep track of the list of clients, and (c) we need to broadcast messages to all clients. After a short prelude, we have the Hydroflow code near the top of run_server(). It begins by defining outbound_chan as a merged destination sink for network messages. Then we get to the more interesting inbound_chan definition. The inbound channel is a source stream that will carry many types of Messages. We use the [demux](./surface_ops.gen.md#demux) operator to partition the stream objects into three channels. The clients channel will carry the addresses of clients that have connected to the server. The msgs channel will carry the ChatMsg messages that clients send to the server. The errs channel will carry any other messages that clients send to the server. Note the structure of the demux operator: it takes a closure on (Message, SocketAddr) pairs, and a variadic tuple (var_args!) of output channel names—in this case clients, msgs, and errs. The closure is basically a big Rust pattern match , with one arm for each output channel name given in the variadic tuple. Note that the different output channels can have different-typed messages! Note also that we destructure the incoming Message types into tuples of fields, to avoid having to write boilerplate code for each message type in every downstream pipeline. use crate::{GraphType, Opts};
use hydroflow::util::{UdpSink, UdpStream}; use crate::protocol::Message; use hydroflow::hydroflow_syntax;
