raph found, maybe failed to parse."); match graph { GraphType::Mermaid => { println!("{}", serde_graph.to_mermaid()); } GraphType::Dot => { println!("{}", serde_graph.to_dot()) } GraphType::Json => { unimplemented!(); // println!("{}", serde_graph.to_json()) } } } df.run_async().await.unwrap();
